function CreateModal() {
    const inputFields = [
        {id: 'name', label: 'Name'},
        {id: 'status', label: 'Status'},
    ];
    return (
      <div className="create-modal">
        <form>
          {
            inputFields.map((inputField) => (
              <div key={inputField.id}>
                <label>{inputField.label}</label>
                <input type="text" />
              </div>
            ))
          }
          <button>Done</button>
        </form>
      </div>
    );
}

export default CreateModal;
